import React from "react";
import {Link} from "react-router-dom";

import hamburger from "../images/hamburger.png";
// import from "../images/";
// import from "../images/";

const Footer = () => {
  return(
    <footer className="footer">
      <Link className="footer-link" to="/" style={{float: "left"}}><i class="fas fa-home"></i></Link>
      <Link className="footer-link" to="/order" style={{marginLeft: "100px"}}>
        <img src={hamburger} alt="hamburger"/>
      </Link>
      <Link className="footer-link" to="/checkout" style={{float: "right"}}><i class="fas fa-shopping-cart"></i></Link>
    </footer>
  );
}

export default Footer;
